(2, 'RainLab.Builder', 'comment', '1.0.1', 'Initialize plugin.', '2021-01-23 02:55:36'),
(3, 'RainLab.Builder', 'comment', '1.0.2', 'Fixes the problem with selecting a plugin. Minor localization corrections. Configuration files in the list and form behaviors are now autocomplete.', '2021-01-23 02:55:36'),
(4, 'RainLab.Builder', 'comment', '1.0.3', 'Improved handling of the enum data type.', '2021-01-23 02:55:36'),
(5, 'RainLab.Builder', 'comment', '1.0.4', 'Added user permissions to work with the Builder.', '2021-01-23 02:55:36'),
(6, 'RainLab.Builder', 'comment', '1.0.5', 'Fixed permissions registration.', '2021-01-23 02:55:36'),
(7, 'RainLab.Builder', 'comment', '1.0.6', 'Fixed front-end record ordering in the Record List component.', '2021-01-23 02:55:36'),
(8, 'RainLab.Builder', 'comment', '1.0.7', 'Builder settings are now protected with user permissions. The database table column list is scrollable now. Minor code cleanup.', '2021-01-23 02:55:36'),
(9, 'RainLab.Builder', 'comment', '1.0.8', 'Added the Reorder Controller behavior.', '2021-01-23 02:55:36'),
(10, 'RainLab.Builder', 'comment', '1.0.9', 'Minor API and UI updates.', '2021-01-23 02:55:36'),
(11, 'RainLab.Builder', 'comment', '1.0.10', 'Minor styling update.', '2021-01-23 02:55:36'),
(12, 'RainLab.Builder', 'comment', '1.0.11', 'Fixed a bug where clicking placeholder in a repeater would open Inspector. Fixed a problem with saving forms with repeaters in tabs. Minor style fix.', '2021-01-23 02:55:36'),
(13, 'RainLab.Builder', 'comment', '1.0.12', 'Added support for the Trigger property to the Media Finder widget configuration. Names of form fields and list columns definition files can now contain underscores.', '2021-01-23 02:55:36'),
(14, 'RainLab.Builder', 'comment', '1.0.13', 'Minor styling fix on the database editor.', '2021-01-23 02:55:36'),
(15, 'RainLab.Builder', 'comment', '1.0.14', 'Added support for published_at timestamp field', '2021-01-23 02:55:36'),
